        db.execSQL("INSERT INTO hive VALUES ('amazing_places','Amazing places','Share those places you have visited or you want to go and that are amazing and not very well known','file_hive_amazing_places.jpg','1900-01-01 00:00:00.000','weirdalien',NULL,'22','3',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('android_fans_eye_candy','Android fans eye candy','Just pictures of broken iPhones','file_hive_android_fans_eye_candy.jpg','1900-01-01 00:00:00.000','coolest_thing_21',NULL,'21','4',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('asi_es_imposible_estar_a_dieta','¡Así es imposible estar a dieta!','Cuando estás a dieta y el mundo se vuelve en tu contra...','file_hive_asi_es_imposible_estar_a_dieta.jpg','1900-01-01 00:00:00.000','akamatsu',NULL,'7','3',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('biraz_daha_kalabilir_misin','Biraz daha kalabilir misin?','Seni çok özledim.','file_hive_biraz_daha_kalabilir_misin.jpg','1900-01-01 00:00:00.000','serezy',NULL,'10','4',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('board_games_nostalgia','Board games nostalgia','Nothing like the old board games... we miss them right? now we all use online games in our PCs and smartphones, but its not the same, no! its not...','file_hive_board_games_nostalgia.jpg','1900-01-01 00:00:00.000','coolest_thing_21',NULL,'6','2',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('chattyhive','Chattyhive','Official chattyhive''s chat for internal communication.','file_hive_chattyhive.jpg','2013-09-01 00:00:00.000','jonathan',NULL,'21','6',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('cities_are_not_for_me','Cities are not for me, sorry','For those who can''t live in a big city and enjoy life in small towns. Why can''t you stand the big cities?','file_hive_cities_are_not_for_me.jpg','1900-01-01 00:00:00.000','coolest_thing_21',NULL,'9','1',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('cool_graffiti','Cool graffiti','Graffiti are also art, and I am sure some of you found some amazing graffiti on the street now and then.. share them here!','file_hive_cool_graffiti.jpg','1900-01-01 00:00:00.000','coolest_thing_21',NULL,'1','0',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('cuando_cae_la_noche','¿En quién te conviertes, cuando cae la noche?','¿A quién no le ha pasado el encontrarse a un compañer@ de trabajo o clases por la noche y no parecerle la misma persona que por el día? Tanto si eres de los que se transforman como de los que sufren las transformaciones de los demás, este es tu hive.','file_hive_cuando_cae_la_noche.jpg','1900-01-01 00:00:00.000','trabuco',NULL,'9','6',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('ebooks_favoritos','Tus ebooks favoritos','Compartir recomendaciones de ebooks, especialmente los de actualidad','file_hive_ebooks_favoritos.jpg','1900-01-01 00:00:00.000','akamatsu',NULL,'2','0',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('enfant_prodige','Enfant prodige','Trouver tout ce que vous devez savoir!','file_hive_enfant_prodige.jpg','1900-01-01 00:00:00.000','weirdalien',NULL,'5','5',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('lets_play_guitar','Lets play guitar!','Are you a pro? still learning? doesn''t matter, join this hive to learn and share about your favourite musical instrument','file_hive_lets_play_guitar.jpg','1900-01-01 00:00:00.000','cassini91',NULL,'6','7',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('lugares_donde_te_gustaria_perderte','¡Lugares donde te gustaría perderte!','Hablemos y compartamos fotos sobre aquellos rincones donde no te importaría perder, y pasar una vida entera o al menos un buen cacho de tiempo. ¿Qué lugares te inspiran más paz?','file_hive_lugares_donde_te_gustaria_perderte.jpg','1900-01-01 00:00:00.000','cassini91',NULL,'22','5',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('minecraft_unofficial_chat','Minecraft - Unofficial chat','This is the best unofficial hive for minecraft''s fans, join us and share the lates news, pictures and experiences of your favourite game.','file_hive_minecraft_unofficial_hive.jpg','1990-04-05 00:00:00.000','weirdalien',NULL,'23','4',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('ojos_y_miradas','Ojos y miradas','Simplemente tus mejores fotos de ojos y miradas. Pueden ser de gente, de animales o de cualquier cosa que imite a un ojo.','file_hive_ojos_y_miradas.jpg','1900-01-01 00:00:00.000','akamatsu',NULL,'6','8',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('pc_general_news_and_thoughts','PC general news and thoughts','This is a general hive for PC lovers. Mac users are not welcome here (nah I am kidding)','file_hive_pc_general_news_and_thoughts.jpg','1900-01-01 00:00:00.000','homer_ou',NULL,'21','1',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('piano_noobs','Piano noobs','Learn first steps with piano joining this hive and sharing with us your tricks and tips','file_hive_piano_noobs.jpg','1900-01-01 00:00:00.000','serezy',NULL,'6','7',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('risky_jobs','Risky jobs','Not all jobs are as safe as they should. What risks do you face everyday in your job? how do you cope with them?','file_hive_risky_jobs.jpg','1900-01-01 00:00:00.000','coolest_thing_21',NULL,'24','6',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('sustos_y_sorpresas','Sustos y sorpresas','Comparte todos esos momentos que han hecho que se te quedasen los ojos cómo platos','file_hive_sustos_y_sorpresas.jpg','1900-01-01 00:00:00.000','weirdalien',NULL,'9','5',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('the_funny_hive','The funny hive','Only funny stuff is allowed','file_hive_the_funny_hive.jpg','1900-01-01 00:00:00.000','trabuco',NULL,'6','5',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('the_moon','The moon!','Just the moon','file_hive_the_moon.jpg','1900-01-01 00:00:00.000','cassini91',NULL,'13','2',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('the_most_beautiful_planet','The most beautiful planet?','You like astronomy so I ask you the following: do you think it would be possible to find a planet as beautiful and complex as our is?','file_hive_the_most_beautiful_planet.jpg','1900-01-01 00:00:00.000','serezy',NULL,'13','2',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('the_sweetest_thing_ever','The sweetest thing ever!','Just talk about what you believe its the sweetest thing that could happen to you... and I am not (just) talking about food','file_hive_the_sweetest_thing_ever.jpg','1900-01-01 00:00:00.000','trabuco',NULL,'9','1',NULL,NULL,NULL,'0','0');");
        db.execSQL("INSERT INTO hive VALUES ('winter_is_coming','Winter is coming...','Brace yourselves, winter is coming. Share how you feel when the cruel cold is coming to your country.','file_hive_winter_is_coming.jpg','1900-01-01 00:00:00.000','homer_ou',NULL,'9','5',NULL,NULL,NULL,'0','0');");
